import React from 'react';
import './IngredientsList.css';


const IngredientsList = props => {
    function renderData() {
      return this.props.data.map(item =>
        <div key={item.id}>
          <p>Name: {item.name}</p>
          <p>Age: {item.age} </p>
        </div>
      )
    }
    
    return (
      <div>{renderData()}</div>
    );
  }
  

export default IngredientsList;
